"use strict";var lobbySocket=io("/lobby");lobbySocket.on("get games",function(){lobbySocket.emit("games list")}),lobbySocket.on("display games",function(e){$("#games").empty();for(var a=0;a<e.length;a++){var n=e[a],o=n.game_id,t=n.game_name,l=n.num_players;console.log("NUMPLAYERS: ",l);var m="Name: "+t+" Players: "+l;if(l<4){var i=$('<form method="POST" action="/lobby/joinGame">\n          <label>"'.concat(m,'"</label>\n          <input type="hidden" name="game_id" value="').concat(o,'"></input>\n          <input type="submit" value="Join Game">\n        </form>'));$("#games").append(i)}else $("#games").append($("<span>").text(m+" Game Full!"))}});